import React, { Component } from 'react';
import {Col, Row, ButtonToolbar, Button, Container} from 'react-bootstrap';
import Link from 'next/link';
import Head from 'next/head';
import Header from '../components/header.js';
import DashboardSection from '../components/dashboardsection.js'
import fetch from 'isomorphic-unfetch'

class Dashboard extends Component {

  static async getInitialProps() {
    const res = await fetch('http://2ee44f55.ngrok.io/User/here@manhattan/password')

    const json = await res.json()
    console.log(json)
    return {test: json}
  }
  render(){
    return (
      <Container>
        <Head>
        <link
        rel="stylesheet"
        href="https://maxcdn.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
        integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T"
        crossOrigin="anonymous"
      />
        </Head>
        <Header />
        <Row>
          <Col>
            <WelcomeMessage name={this.props.test["First_name"]} />
            <DashboardSection title="Alerts" />
            <DashboardSection title="Accounts" />
            <DashboardSection title="Bills" />
          </Col>
        </Row>
      </Container>
    )
  }
}


class WelcomeMessage extends Component {

  render(){
    return (
      <Row>
        <Col>
        <p>Welcome, {this.props.name} </p>
        </Col>
      </Row>
    )
  }
}


export default Dashboard
